    public class IntRange
    {
        public int start;
        public int length;
        public IntRange (int start, int length)
        {
            this.start = start;
            this.length = length;
        }
        public bool inRange(int value)
        {
            return value >= start && value < end();
        }

        public int end()
        {
            return start + length;
        }
    }

